//page의 공통 부분 처리
import React from 'react';
import 'antd/dist/antd.css';
import PropTypes from 'prop-types'

const Nodebird = ({Component}) => {
    return(
        <Component />
    );
}

Nodebird.propTypes = {
    Componenet : PropTypes.elementType.isRequired,
}

export default Nodebird;
